import React from "react";
import { NavLink } from "react-router-dom";

const Join = props => {
  return (
  <div>
    <section className="page-section mb-0" id="join">
        <div className="container">
            <h4 className="page-section-heading text-center">JOIN OUR SOCIETY</h4>
        </div>
    </section>
  </div>
  );
};

export default Join;
